import React from "react";
import Row from "../Row/Row";
import Card from "../Card/Card";

export default function Books(props) {
  return (
    <div className="book-container">
      {props.view === "row" ? (
        <Row books={props.myLibrary} />
      ) : (
        <Card books={props.myLibrary} />
      )}
    </div>
  );
}
